--

CREATE FUNCTION public.agregarproducto(folio_orden character, id_producto_agregado integer) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
	info_orden restaurante.orden%ROWTYPE;
	info_producto restaurante.producto%ROWTYPE;
BEGIN
	/*
		Cada que se agregue un producto a la orden, debe actualizarse los totales (por producto y venta), así
		como validar que el producto esté disponible
	*/
	-- Primero se analizará si el producto está disponible y si el folio es correcto
	SELECT * INTO info_orden FROM restaurante.orden WHERE folio = folio_orden;
	IF NOT NULL THEN
		-- En este caso significa que si hay una orden con el folio indicado
		-- Se procede a analizar si existe el producto señalizado y está disponible
		SELECT * INTO info_producto FROM restaurante.producto WHERE id_alimento = id_producto_agregado AND disponibilidad = 'true';
		IF NOT NULL THEN 
			-- En este caso ya se verificó que el producto existe y está disponible
			-- En dicho caso, se procede a agregar el producto a la tabla 
			UPDATE restaurante.producto SET id_alimento = id_producto_agregado, cantidad = cantidad + 1 
			WHERE folio = folio_orden;
			UPDATE restaurante.producto SET total_producto = cantidad * info_producto.precio;
		ELSE
			RAISE EXCEPTION 'No se encontró el producto o el producto no está disponible';
		END IF;
	ELSE
		RAISE EXCEPTION 'No se encontró la orden con el folio %.', folio_orden;
	END IF;
END 
$$;


