CREATE PROCEDURE restaurante.agregar_cliente(IN folio_orden character, IN rfc_dado character, IN nombre_cliente character varying, IN apellido_pat_cliente character varying, IN apellido_mat_cliente character varying, IN fecha_nacimiento_cliente date, IN estado_cliente character varying, IN cp_cliente character, IN colonia_cliente character varying, IN calle_cliente character varying, IN numero_cliente smallint, IN email_cliente character varying, IN razon_social_cliente text)
    LANGUAGE plpgsql
    AS $$
DECLARE 
	rfc_cliente char(13);
	folio char(7);
BEGIN
	-- Se desea realizar facturación, por lo que el cliente brinda su información fiscal
	-- En este caso, es necesario analizar si el cliente ya ha realizado facturas. 
	SELECT ro.folio INTO folio FROM restaurante.orden ro WHERE ro.folio = folio_orden;
	IF folio IS NOT NULL THEN
		-- Se agregó correctamente el folio
		-- Se valida que el RFC existe o no.
		SELECT rc.rfc INTO rfc_cliente FROM restaurante.cliente rc WHERE rc.rfc = rfc_dado;
		IF rfc_cliente IS NOT NULL THEN
			-- El cliente ya ha facturado anteriormente
			-- Únicamente se agrega el RFC a la orden
			UPDATE restaurante.orden SET rfc_cliente = rfc_dado WHERE restaurante.orden.folio = folio_orden;
		ELSE
			-- Se debe de crear el registro para el cliente y agregar el RFC a la orden
			INSERT INTO restaurante.cliente (rfc,nombre,apellido_pat,apellido_mat,fecha_nacimiento,estado,cp,colonia,calle,numero,email,razon_social)
			VALUES(rfc_dado,nombre_cliente,apellido_pat_cliente,apellido_mat_cliente,fecha_nacimiento_cliente,estado_cliente,cp_cliente,colonia_cliente,calle_cliente,numero_cliente,email_cliente,razon_social_cliente);
			UPDATE restaurante.orden SET rfc_cliente = rfc_dado WHERE restaurante.orden.folio = folio_orden;
		END IF;
	ELSE 
		RAISE EXCEPTION 'No se encontró la orden con folio %s. Verifique que está agregando la información correcta.', folio_orden;
	END IF;
END; 
$$;


