CREATE PROCEDURE restaurante.agregar_empleado(IN rfc character, IN nombre character varying, IN apellido_pat character varying, IN apellido_mat character varying, IN fecha_nacimiento date, IN edad smallint, IN estado character varying, IN cp character, IN colonia character varying, IN calle character varying, IN numero smallint, IN mesero boolean, IN horario character, IN administrativo boolean, IN rol character varying, IN cocinero boolean, IN especialidad character varying, IN sueldo double precision, IN foto bytea, IN telefonos bigint[] DEFAULT NULL::bigint[])
    LANGUAGE plpgsql
    AS $$
DECLARE 
	telefono bigint;
BEGIN
	INSERT INTO restaurante.empleado (rfc,nombre,apellido_pat,apellido_mat,fecha_nacimiento,edad,estado,cp,colonia,calle,numero,foto,es_mesero,horario,es_admin,rol,es_cocinero,especialidad,sueldo)
	VALUES(RFC,nombre,apellido_pat,apellido_mat,fecha_nacimiento,edad,estado,cp,colonia,calle,numero,foto,mesero,horario,administrativo,rol,cocinero,especialidad,sueldo);
	-- Se debe de ir agregando los respectivos números telefónicos
	IF telefonos IS NOT NULL THEN
		FOREACH telefono IN ARRAY telefonos
		LOOP
			INSERT INTO restaurante.telefono(num_empleado,telefono) VALUES (currval('restaurante.id_empleado_seq'::regclass),telefono);
		END LOOP;
	END IF;
	EXCEPTION
		WHEN others THEN
			PERFORM setval('restaurante.id_empleado_seq'::regclass, currval('restaurante.id_empleado_seq'::regclass) - 1);
		RAISE NOTICE 'Error al agregar al empleado';

