CREATE PROCEDURE restaurante.agregar_orden(IN id_mesero integer)
    LANGUAGE plpgsql
    AS $$
DECLARE 
	num_trabajador integer;
BEGIN
	-- Se tiene que valir que el número de trabajador corresponda a un mesero
	SELECT re.num_empleado INTO num_trabajador FROM restaurante.empleado re WHERE re.num_empleado = id_mesero AND re.es_mesero = 'true';
