CREATE FUNCTION restaurante.obtener_info_empleados(nombre_empleado character varying) RETURNS TABLE(num_empleado integer, rfc character, nombre character varying, apellido_pat character varying, apellido_mat character varying, fecha_nacimiento date, edad smallint, estado character varying, cp character, colonia character varying, calle character varying, numero smallint, foto bytea, es_mesero boolean, horario character varying, es_administrativo boolean, rol character varying, es_cocinero boolean, especialidad character varying, sueldo double precision, telefonos text)
    LANGUAGE plpgsql
    AS $$
DECLARE
	cadena character varying;
BEGIN
	cadena := '%%' || rtrim(ltrim(lower(nombre_empleado))) || '%%';
	RETURN QUERY 
	SELECT * FROM restaurante.empleado re JOIN (SELECT rt.num_empleado, STRING_AGG(telefono::TEXT, ', ') AS telefonos FROM restaurante.telefono rt GROUP BY rt.num_empleado)
	USING (num_empleado) WHERE lower(re.nombre) LIKE cadena ORDER BY num_empleado;
END
$$;


