--
-- Name: ventas_por_fecha(date); Type: FUNCTION; Schema: restaurante; Owner: postgres
--

CREATE FUNCTION restaurante.ventas_por_fecha(fecha date) RETURNS TABLE(cantidad integer, total double precision)
    LANGUAGE plpgsql
    AS $$
DECLARE 
total_ventas double precision = 0.0;
cantidad_ventas integer = 0;
fila_ventas restaurante.orden%ROWTYPE;
BEGIN
	/*
		Dada una fecha, regresar el número de ventas y el total dado por las ventas
	*/
	-- Para esto, se tiene el registro de las ordenes tomadas. Cada orden tiene el monto total y la fecha en formato timestamp
	FOR fila_ventas IN SELECT * FROM restaurante.orden LOOP
		-- Se verifica si la orden fue realizada en la fecha dada
		IF DATE(fila_ventas.fecha) = fecha THEN
			cantidad_ventas = cantidad_ventas + 1;
			total_ventas = total_ventas + fila_ventas.total;
		ELSE
			CONTINUE;
		END IF;
    END LOOP;
	RETURN QUERY SELECT cantidad_ventas,total_ventas;
END 
$$;


ALTER FUNCTION restaurante.ventas_por_fecha(fecha date) OWNER TO postgres;

--
-- Name: ventas_por_fecha(date, date); Type: FUNCTION; Schema: restaurante; Owner: postgres
--

CREATE FUNCTION restaurante.ventas_por_fecha(fecha_inferior date, fecha_superior date) RETURNS TABLE(cantidad integer, total double precision)
    LANGUAGE plpgsql
    AS $$
DECLARE 
total_ventas double precision = 0.0;
cantidad_ventas integer = 0;
fila_ventas restaurante.orden%ROWTYPE;
BEGIN
	/*
		Dada una fecha, regresar el número de ventas y el total dado por las ventas
	*/
	IF fecha_inferior < fecha_superior THEN
		-- Para esto, se tiene el registro de las ordenes tomadas. Cada orden tiene el monto total y la fecha en formato timestamp
		FOR fila_ventas IN SELECT * FROM restaurante.orden LOOP
			-- Se verifica si la orden fue realizada en la fecha dada
			IF DATE(fila_ventas.fecha) >= fecha_inferior AND DATE(fila_ventas.fecha) <= fecha_superior THEN
				cantidad_ventas = cantidad_ventas + 1;
				total_ventas = total_ventas + fila_ventas.total;
			ELSE
				CONTINUE;
			END IF;
		END LOOP;
		RETURN QUERY SELECT cantidad_ventas,total_ventas;
	ELSE
		RAISE EXCEPTION 'Ingrese un intervalo válido. La fecha inferior es mayor que la superior.';
	END IF;
END 
$$;


ALTER FUNCTION restaurante.ventas_por_fecha(fecha_inferior date, fecha_superior date) OWNER TO postgres;

