-- Name: cliente; Type: TABLE; Schema: restaurante; Owner: postgres
--

CREATE TABLE restaurante.cliente (
    rfc character(13) NOT NULL,
    nombre character varying(60) NOT NULL,
    apellido_pat character varying(60) NOT NULL,
    apellido_mat character varying(60) NOT NULL,
    fecha_nacimiento date NOT NULL,
    estado character varying(30) NOT NULL,
    cp character(5) NOT NULL,
    colonia character varying(30) NOT NULL,
    calle character varying(60) NOT NULL,
    numero smallint NOT NULL,
    email character varying(120) NOT NULL,
    razon_social text NOT NULL
);


ALTER TABLE restaurante.cliente OWNER TO postgres;

--
-- Name: orden; Type: TABLE; Schema: restaurante; Owner: postgres
--

CREATE TABLE restaurante.orden (
    folio character(7) NOT NULL,
    fecha timestamp with time zone DEFAULT now() NOT NULL,
    total double precision DEFAULT 0.0 NOT NULL,
    id_mesero integer NOT NULL,
    rfc_cliente character(13) DEFAULT NULL::bpchar
);


ALTER TABLE restaurante.orden OWNER TO postgres;

--
-- Name: datos_cliente; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.datos_cliente AS
 SELECT rc.rfc,
    rc.nombre,
    rc.apellido_pat,
    rc.apellido_mat,
    rc.fecha_nacimiento,
    rc.estado,
    rc.cp,
    rc.colonia,
    rc.calle,
    rc.numero,
    rc.email,
    rc.razon_social,
    ro.folio,
    ro.fecha,
    ro.total,
    ro.id_mesero,
    ro.rfc_cliente
   FROM (restaurante.cliente rc
     JOIN restaurante.orden ro ON ((rc.rfc = ro.rfc_cliente)));


ALTER VIEW public.datos_cliente OWNER TO postgres;

--
-- Name: categoria; Type: TABLE; Schema: restaurante; Owner: postgres
