ALTER SEQUENCE restaurante.categoria_id_categoria_seq OWNED BY restaurante.categoria.id_categoria;


--
-- Name: datos_cliente; Type: VIEW; Schema: restaurante; Owner: postgres
--

CREATE VIEW restaurante.datos_cliente AS
 SELECT rfc,
    nombre,
    apellido_pat,
    apellido_mat,
    fecha_nacimiento,
    estado,
    cp,
    colonia,
    calle,
    numero,
