    nombre character varying(60) NOT NULL,
    descripcion text NOT NULL,
    precio double precision NOT NULL,
    disponibilidad boolean NOT NULL,
    receta text NOT NULL,
    id_categoria integer NOT NULL,
    ventas integer DEFAULT 0
);


ALTER TABLE restaurante.producto OWNER TO postgres;

--
-- Name: platillo_mas_vendido; Type: VIEW; Schema: restaurante; Owner: postgres
--

CREATE VIEW restaurante.platillo_mas_vendido AS
 SELECT id_alimento,
    nombre,
    descripcion,
    precio,
    disponibilidad,
    receta,
    id_categoria,
    ventas
   FROM restaurante.producto rp
  WHERE (ventas IN ( SELECT max(rp_1.ventas) AS max
           FROM restaurante.producto rp_1));


ALTER VIEW restaurante.platillo_mas_vendido OWNER TO postgres;

