--
-- Name: ticket; Type: VIEW; Schema: restaurante; Owner: postgres
--

CREATE VIEW restaurante.ticket AS
 SELECT rp.nombre,
    ocp.cantidad,
    ocp.total_producto
   FROM (restaurante.orden_contiene_producto ocp
     JOIN restaurante.producto rp ON ((ocp.id_alimento = rp.id_alimento)))
  WHERE (ocp.folio = 'ORD-001'::bpchar);


ALTER VIEW restaurante.ticket OWNER TO postgres;

